import React, { useState } from 'react';
import '../styles/UserPreferencesForm.css'; 

const UserPreferencesForm = () => {
  const [type, setType] = useState('dog');
  const [size, setSize] = useState('any');
  const [age, setAge] = useState(0);
  const [gender, setGender] = useState('any');
  const [temperament, setTemperament] = useState([]);

  const handleAgeChange = (event) => {
    setAge(event.target.value);
  };

  const handleTemperamentChange = (event) => {
    const value = event.target.value;
    if (temperament.includes(value)) {
      setTemperament(temperament.filter((item) => item !== value));
    } else {
      setTemperament([...temperament, value]);
    }
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    // Filter pets based on user preferences
    const filteredPets = petData.filter((pet) => {
      return (
        (activity === 'any' || pet.type === activity) &&
        (size === 'any' || pet.size === size) &&
        (gender === 'any' || pet.gender === gender) &&
        (pet.age <= age) &&
        (temperament.length === 0 || temperament.every((t) => pet.temperament.includes(t)))
      );
    });

    // TODO: Display or process filtered pets in your application as needed
  };

  return (
    <div className="container">
      <h2>Find your perfect match:</h2>
      <form onSubmit={handleSubmit}>
        {/* <label>Type:</label> */}
          <div className="form-options">
            <label><input type="radio" name="activity" value="dog" /> Dog 🐶</label>
            <label><input type="radio" name="activity" value="cat"   /> Cat 🐱</label>
            <label><input type="radio" name="activity" value="other"  /> Other 🐴🐓🐷</label>
          </div>
        <div className="form-options">
          <div className="form-option">
            <label htmlFor="size">Size:</label>
            <select id="size" value={size} onChange={(event) => setSize(event.target.value)}>
              <option value="any">Any</option>
              <option value="small">Small</option>
              <option value="medium">Medium</option>
              <option value="large">Large</option>
            </select>
          </div>
          <div className="form-option">
          <label htmlFor="size">Gender:</label>
            <select id="gender" value={gender} onChange={(event) => setGender(event.target.value)}>
              <option value="any">Any</option>
              <option value="female">Female</option>
              <option value="male">Male</option>
            </select>
          </div>
        </div>

        <label>Age Range:</label>
        <input
          type="range"
          id="age"
          value={age}
          onChange={handleAgeChange}
          min="0"
          max="10"
          />
        <span>
        {age < 1 ? 'Baby' : age <= 3 ? 'Young' : age <= 6 ? 'Adult' : 'Senior'}
        </span>

        <label>Characteristics:</label>
          <div className="temperament-options">
            <label><input type="checkbox" name="temperament" value="friendly" checked={temperament.includes('friendly')} onChange={handleTemperamentChange} /> Friendly 🙂 </label>
            <label><input type="checkbox" name="temperament" value="playful" checked={temperament.includes('playful')} onChange={handleTemperamentChange} /> Playful 🎾 </label>
            <label><input type="checkbox" name="temperament" value="smart" checked={temperament.includes('smart')} onChange={handleTemperamentChange} /> Smart 😌 </label>
            <label><input type="checkbox" name="temperament" value="gentle" checked={temperament.includes('gentle')} onChange={handleTemperamentChange} /> Gentle 🥹 </label>
            <label><input type="checkbox" name="temperament" value="funny" checked={temperament.includes('funny')} onChange={handleTemperamentChange} /> Funny 🤪 </label>
          </div>

        <button type="submit">Find My Match</button>
      </form>
    </div>
  );
};

export default UserPreferencesForm;
